import React from 'react';
import '../styling/Header.css';
import Filters from "./Filters";
import InformationTip from "./InformationTip";


const Header = () => {
    return (
        <div className="header_container">
            <header>
                <div className="logo">Tampa Bay Twitter Environmental Analytics Dashboard</div>
                <InformationTip information="
  <ul>
    <li><strong>Time select:</strong> Default: from 2018 to present day.</li>
    <li><strong>Account type:</strong> Default: All Accounts selected.</li>
    <li><strong>Word Cloud:</strong> Default: Non Geo Hashtags Selected.</li>
    <li><strong>County:</strong> Default: All counties selected.</li>
    <li><strong>To be added later:</strong> which filters are connected to what, and frequency of data collection.</li>
  </ul>
"/>

            </header>

        </div>

    );
};

export default Header;
